    public BigDecimal getDistanceBetweenModulesAndCascade(List<String> module1, List<String> module2, List<String> cascade, String inMapping, String outMapping) {
        STLflatAbstractSyntaxTreeExtractor stlmodule1Input = new STLflatAbstractSyntaxTreeExtractor();
        STLflatAbstractSyntaxTreeExtractor stlmodule1Output = new STLflatAbstractSyntaxTreeExtractor();
        STLflatAbstractSyntaxTreeExtractor stlmodule2Input = new STLflatAbstractSyntaxTreeExtractor();
        STLflatAbstractSyntaxTreeExtractor stlmodule2Output = new STLflatAbstractSyntaxTreeExtractor();
        STLflatAbstractSyntaxTreeExtractor stlcascade1Input = new STLflatAbstractSyntaxTreeExtractor();
        STLflatAbstractSyntaxTreeExtractor stlcascade1Internal = new STLflatAbstractSyntaxTreeExtractor();
        STLflatAbstractSyntaxTreeExtractor stlcascade1Output = new STLflatAbstractSyntaxTreeExtractor();
        
        stlmodule1Input = STLflatAbstractSyntaxTreeExtractor.getSTLflatAbstractSyntaxTreeExtractor(module1.get(0));
        stlmodule1Output = STLflatAbstractSyntaxTreeExtractor.getSTLflatAbstractSyntaxTreeExtractor(module1.get(1));
        stlmodule2Input = STLflatAbstractSyntaxTreeExtractor.getSTLflatAbstractSyntaxTreeExtractor(module2.get(0));
        stlmodule2Output = STLflatAbstractSyntaxTreeExtractor.getSTLflatAbstractSyntaxTreeExtractor(module2.get(1));
        stlcascade1Input = STLflatAbstractSyntaxTreeExtractor.getSTLflatAbstractSyntaxTreeExtractor(cascade.get(0));
        stlcascade1Internal = STLflatAbstractSyntaxTreeExtractor.getSTLflatAbstractSyntaxTreeExtractor(cascade.get(1));
        stlcascade1Output = STLflatAbstractSyntaxTreeExtractor.getSTLflatAbstractSyntaxTreeExtractor(cascade.get(2));
        
        Map<String, List<String>> mapping = new HashMap<String, List<String>>();
        
        List<String> signal = new ArrayList<String>();
        
        signal.add(inMapping);
        
        mapping.put(outMapping, signal);
        
        STLflat mod1mod2Internal = Compose.composeWithConcatenate(stlmodule1Output.spec, stlmodule2Input.spec, mapping);
        
        CostFunction cost = new CostFunction();
        
        cost.setAlphaF(100);
        cost.setAlphaFprime(100);
        cost.setAlphaG(100);
        cost.setAlphaGprime(100);
        
        BigDecimal inputDistance = cost.computeDistance(stlmodule1Input.spec, stlcascade1Input.spec);
//        BigDecimal inputDistance = cost.computeDistance(stlcascade1Input.spec, stlmodule1Input.spec);
        BigDecimal internalDistance = cost.computeDistance(mod1mod2Internal, stlcascade1Internal.spec);
//        BigDecimal internalDistance = cost.computeDistance(stlcascade1Internal.spec, mod1mod2Internal);
        BigDecimal outputDistance = cost.computeDistance(stlmodule2Output.spec, stlcascade1Output.spec);
//        BigDecimal outputDistance = cost.computeDistance(stlcascade1Output.spec, stlmodule2Output.spec);
        
        BigDecimal result = max(max(inputDistance, internalDistance), outputDistance);
//        BigDecimal result = max(inputDistance, outputDistance);
//        BigDecimal result = inputDistance.add(internalDistance).add(outputDistance);
//        BigDecimal result = inputDistance.add(outputDistance);
//        BigDecimal result = new BigDecimal(inputDistance.longValue());
//        result = result.add(internalDistance);
//        result = result.add(outputDistance);
        
        return result;
    }
    
